import React,{useEffect,useState}from 'react';
import axios from "axios";

function introduccion() {
    const [data,setData]=useState([]);

    useEffect(()=>{
        axios.get("http://localhost:3002/")
        .then(res=>{
            setData(res.data.contact)
        })
        .catch(error=>console.log(error));
    },[]);

    const myJson=data[0];
    

  return (
    <div className="container">
      <div className="row align-items-start">
        <div className="col-lg-6 col-md-6 col-sm-12">
          <h1>Hi, I am Alejandro Ramírez :)</h1>
          <h4>and I am a software developer</h4>
          <h6>
            Right now I don´t have much experience, but I keep trying to learn
            new technologies and improve them, so I can become one day a
            fullStack developer
          </h6>
        </div>
        <div className="col-lg-6 col-md-6 col-sm-12">
          Here will go the image
        </div>
      </div>
    </div>
  );
}
export default introduccion;
